<!DOCTYPE html>
<html lang="en">
<head>
	<script language="JavaScript">
	var howMany = 2;
	var page = new Array(howMany+1);

	page[0]="https://script.google.com/macros/s/AKfycbzvU7hikCkw3z5O_IZWU-Qfzwvp66pTYrXRHTRXKLv-DuhR9oSU/exec";
	page[1]="https://script.google.com/macros/s/AKfycbxsgq5MHdYp6ADoJ-zOGYHfQdtVvQQoB9hH0SeBPEncs0p21AuZ/exec";
	page[2]="https://script.google.com/macros/s/AKfycby8r_YtqqP8ffIpFRAqKFyJ3ZXrpWAoKb1dkB0zYXFLEtCtwHg/exec";

	function rndnumber(){
		var randscript = -1;
		while (randscript < 0 || randscript > howMany || isNaN(randscript)){
			randscript = parseInt(Math.random()*(howMany+1));
		}
		return randscript;
	}
	quo = rndnumber();
	quox = page[quo];
	window.location=(quox);
	</script>
